import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a category to make the sort controls appear
    // The JS in the page generates these controls on category/search view
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.locator('div.category-card:has-text("Electronics")').click();

    // Wait for the sort dropdown to be visible
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_sort_controls_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_sort_controls_visible.png'));

    // Select the "Price: High to Low" sort option
    const sortSelector = '#sortSelect';
    await page.selectOption(sortSelector, 'price-high');

    // Take a screenshot after applying the sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract the selected value to verify the action
    const selectedSortValue = await page.locator(sortSelector).inputValue();

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter.",
      extractedData: {
        selectedSort: selectedSortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
